-A ufw-user-input -s 1.44.96.0/24 -j DROP

### tuple ### deny any any 0.0.0.0/0 any 1.178.1.0/24 in comment=7566772d626f7473
-A ufw-user-input -s 1.178.1.0/24 -j DROP

